proc getRanged(xMin,xMax:int) :seq[int]=
  let L = xMax - xMin + 1
  result = newSeq[int](L)
  for a in xMin.sqrt..xMax.sqrt:
    let c = a * a - xMin
    if c >= 0 and c < L: result[c] += 1
  for a in (xMin div 2).sqrt..( xMax div 2 ).sqrt:
    let c = 2 * a * a - xMin
    if c >= 0 and c < L: result[c] += 1
  for a in 1..xMax.sqrt:
    for b in xMin.sqrt..xMax.sqrt:
      if b - a * a < 0: continue
      let c = (b - a * a).sqrt - xMin
      if c >= 0 and c < L: result[c] += 2
